import { Fragment } from "react";
import { Link } from "react-router-dom";
import { useSelector } from "react-redux";
import { FaArrowLeft, FaArrowRight } from "react-icons/fa";

import HistoryBanner from "../components/pages/history/HistoryBanner";
import HistoryTable from "../components/pages/history/HistoryTable";
import HistoryTotal from "../components/pages/history/HistoryTotal";
import NotLogin from "./NotLogin";
import "./History.css";

const History = () => {
  // Current user
  const user = useSelector((state) => state.user.user);

  // If user did not login
  if (!user) return <NotLogin />;

  // If user logged in
  return (
    <Fragment>
      <HistoryBanner />
      <h5 className="mb-4">HISTORY</h5>
      <div className="row history-item-list">
        <div className="col-sm-6 col-lg-8 px-4 mb-4">
          <HistoryTable />
        </div>
        <div className="col-sm-6 col-lg-4 mb-4">
          <HistoryTotal />
        </div>
        <div className="col-lg-8 history-footer mb-4">
          <Link to="/shop">
            <FaArrowLeft /> Continue shopping
          </Link>
          <Link to="/checkout" className="history-checkout">
            Proceed to checkout <FaArrowRight />
          </Link>
        </div>
      </div>
    </Fragment>
  );
};

export default History;
